import React from 'react';
import GenerateWebData from './GenerateWebData';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Web Data Generator</h1>
      </header>
      <main style={{ padding: '20px' }}>
        <GenerateWebData />
      </main>
    </div>
  );
}

export default App;
